import React from "react";
import Logo from "./logoCofco.png";
const Footer = () => {
  return (
    <footer className="footer bg-white">
      <div>&nbsp;</div>
      <div>&nbsp;</div>
      <img
        src={Logo}
        width="128"
        height="40"
        className="d-inline-block align-top"
      />
    </footer>
  );
};
export default Footer;
